/* global google */
import React, { Component } from "react";
import {
  withGoogleMap,
  withScriptjs,
  GoogleMap,
  DirectionsRenderer
} from "react-google-maps";
class Map extends Component {
  constructor(props) {
    super(props);
    navigator.geolocation.getCurrentPosition(location => {
      //console.log(location.coords);
      this.setState({ currentLocation: location.coords });
    });
  }
  state = {
    directions: this.currentLocation,
    currentLocation: null
  };

  showLocation(location) {
    //console.log(location.coords);
    this.setState({ currentLocation: location.coords });
  }

  componentWillMount() {
    navigator.geolocation.getCurrentPosition(location => {
      //console.log(location.coords);
      this.setState({ currentLocation: location.coords });
    });
  }
  componentDidMount() {
    const directionsService = new google.maps.DirectionsService();

    const origin = {
      lat: this.state.currentLocation.latitude,
      lng: this.state.currentLocation.longitude
    };
    const destination = { lat: 41.756795, lng: -78.954298 };

    directionsService.route(
      {
        origin: origin,
        destination: destination,
        travelMode: google.maps.TravelMode.WALKING
      },
      (result, status) => {
        if (status === google.maps.DirectionsStatus.OK) {
          this.setState({
            directions: result
          });
        } else {
          console.error(`error fetching directions ${result}`);
        }
      }
    );
  }

  render() {
    navigator.geolocation.getCurrentPosition(location => {
      this.setState({ currentLocation: location.coords });
    });
    const GoogleMapExample = withGoogleMap(props => (
      <GoogleMap
        defaultCenter={{
          lat: this.state.currentLocation
            ? this.state.currentLocation.latitude
            : 50,
          lng: this.state.currentLocation
            ? this.state.currentLocation.longitude
            : 50
        }}
        defaultZoom={13}
      >
        <DirectionsRenderer directions={this.state.directions} />
      </GoogleMap>
    ));

    return (
      <div>
        <GoogleMapExample
          currentLocation={this.state.currentLocation}
          containerElement={<div style={{ height: `500px`, width: "500px" }} />}
          mapElement={<div style={{ height: `100%` }} />}
        />
      </div>
    );
  }
}

export default Map;

